import { StyleSheet, Text,  View } from 'react-native'
import React from 'react'

const Ads = () => {
  return (
    <View style={styles.conatainer}>
      <View>

      </View>
      <View></View>
    </View>
  )
}

export default Ads

const styles = StyleSheet.create({
    conatainer: {
        height: 130,
        backgroundColor: '#E6606F',
        marginHorizontal: 24,
        borderRadius: 30,
    }
})
